// Contactinfo.js

import React from "react";
import './Contactinfo.css';

//import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
//import { faTrash, faEdit } from '@fortawesome/fontawesome-free-solid';


class Contactinfo extends React.Component {
    handleClick(e) {
        this.setState({
          editModeEnabled: e.target.disabled
        })
        console.log('yes')
        alert('worked?')
      }


    render () {
    return (
        <div id="contact-info">
        <ul>
            <input id="full-name" type="text" value={this.props.firstName} disabled={!this.props.editModeEnabled} onClick={this.props.handleClick}></input>
        </ul>
        <ul>
            {this.props.emailAddress}  ||  {this.props.phoneNumber}
        </ul>
        </div>
        );

    }
}




export default Contactinfo;
